        return preg_replace_callback($this->emoji_maps['unified_rx'], function($m){
            if (isset($m[2]) && $m[2] == "\xEF\xB8\x8E") return $m[0];
            $cp = $this->emoji_maps['unified_to_html'][$m[1]];
            return isset($this->nameToNum[$cp]) ? "<img class=\"emoji_icon\" src=\"/room/dist/img/tieba2/{$this->nameToNum[$cp]}.png\" code=\"{$cp}\">" : "";
        }, $text);
    }

    public function emoji_html_to_unified2($text)
    {
        return preg_replace_callback("!<img class=\"emoji_icon\" src=\"(.*?)\" title=\"([0-9a-f]+)\">!", function ($m) {
            if (isset($this->emoji_maps['html_to_unified'][$m[2]])) {
